  \"Develop Inventory Protocols for frogs within the Region 1 Great Northern and Great
  Basin LCC, Protocol Development & Remote Audial Inventory\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:56:04.738857\",\n\t\"name\": \"develop-inventory-protocols-for-frogs-within-the-region-1-great-northern-and-great-basin-l\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Many refuges lack basic information on
  distribution of frogs, but conducting inventory surveys for frogs can be problematic.
  Different species breed at different times, breeding periods are often short and
  highly dependent on local weather and water conditions, and difference in life history
  and habits make some survey methods suitable for some species, but inappropriate
  for others. Despite these challenges, a suite of suggested survey protocols was
  developed to guide individual refuges needing more information on frog species.
  \  This project had 2 objectives.  Objective 1: Protocol Development. Develop a
  suite of protocols, based on species.  Refuges would be grouped by geography, habitat
  type, and frog species expected.  Survey timing windows for different species would
  be identified based on survey method and refuge location. An amphibian expert would
  visit a subset of refuges to identify specific locations on individual refuges to
  focus survey efforts. Objective 2: Remote audial inventory. Test the use of remote
  audial recording devises to determine presence/absence of certain frog species.\",\n\t\"license_title\":
